import React from 'react';
import { motion } from 'framer-motion';

export const TetOverlay = () => (
  <div className="fixed inset-0 pointer-events-none z-50">
    {/* Hoa mai r∆°i */}
    {[...Array(15)].map((_, i) => (
      <motion.div
        key={i}
        initial={{ 
          x: Math.random() * window.innerWidth,
          y: -50,
          rotate: 0 
        }}
        animate={{ 
          y: window.innerHeight + 50,
          rotate: 360,
          opacity: [0, 1, 1, 0]
        }}
        transition={{
          duration: Math.random() * 3 + 2,
          repeat: Infinity,
          delay: Math.random() * 2
        }}
        className="absolute text-2xl"
        style={{
          filter: 'drop-shadow(0 0 2px rgba(255,223,0,0.3))'
        }}
      >
        {Math.random() > 0.5 ? 'üå∏' : '‚ú®'}
      </motion.div>
    ))}

    {/* ƒê√®n l·ªìng g√≥c - v·ªõi m√†u nh·∫π nh√†ng h∆°n */}
    <motion.div
      animate={{ y: [0, -5, 0] }}
      transition={{ duration: 2, repeat: Infinity }}
      className="fixed top-20 left-10 opacity-60"
    >
      <span className="text-5xl">üèÆ</span>
    </motion.div>
    <motion.div
      animate={{ y: [0, 5, 0] }}
      transition={{ duration: 2.5, repeat: Infinity }}
      className="fixed top-20 right-10 opacity-60"
    >
      <span className="text-5xl">üèÆ</span>
    </motion.div>
  </div>
);
